    false,nt"url": null,nt"notes": "This report concerns a cattle grazing program
    initiated in 1987 on Alamosa National Wildlife Refuge to control tall whitetop (lepedium
    latifolium) with a major goal of maintaining healthy and diverse plant communities
    containing vegetative cover attractive to wildlife,  Grazing occurred on irrigated
    and subirrigated rangeland consisting primarily of a wet meadow range site. Since
    1987 grazing season of use  has been during the summer with cattle being moved through
    several pastures. Each pasture is grazed more than once during the season with several
    days of rest occurring before the same pasture is regrazed. Overall vegetative health
    and vigor have improved. Whitetop plants are still numerous; however, few plants
    produce seed stalks. Whitetop density is decreasing while grasses are increasing.
    Baltic rush (Juncus balticus) has remained relatively stable.",nt"license_title":
